long_desc.thetext:
The erasure of a signature of a method has no type parameters. For example, if the following method declarations are added in a class a compiler error is generated.
public <T>  String setArrayList(ArrayList<T> arrayList);
	public   String setArrayList(ArrayList arrayList);

The compiler error message, listed below, is not accurate:
Method setArrayList(ArrayList) has the same erasure setArrayList(ArrayList<E>) as another method

Erasure of a method has no type parameters yet in the compiler error message the type parameter E is specified. The erasure of the first method is 

public   String setArrayList(ArrayList arrayList);

The erasure of the second method is the same as the method declaration.

Consider the following example:

1. import java.util.List;
2. 
3. class X {
4. 	void foo(List<Integer> x) {}
5. 	void foo(List<String> x)  {}
6. 	void foo(List<Double> x)  {}
7. }

Line6: Method foo(List<Double>) has the same erasure foo(List<E>) as another method in type X

Line4: Method foo(List<Integer>) has the same erasure foo(List<E>) as another method in type X	

Line5: Method foo(List<String>) has the same erasure foo(List<E>) as another method in type X

Q. Should we put up three errors or only two. Should there be any errors for 
void foo(List<Integer> x) {} (the first function).

Thanks
